function detailWorkflowDetailDialog(el) {
    var data = $(el).data('detail');
    $('.clear').val('');
    $('#md-WorkflowDetail-detail').modal('show');

				$('#Detail-WorkflowDetail-AutoApprovedExpired').val(data.autoApprovedExpired);
				$('#Detail-WorkflowDetail-CanAdhoc').prop('checked', data.canAdhoc);
				$('#Detail-WorkflowDetail-Email').val(data.email);
				$('#Detail-WorkflowDetail-FullName').val(data.fullName);
				$('#Detail-WorkflowDetail-GroupNo').val(data.groupNo);
				$('#Detail-WorkflowDetail-IdUser').val(data.idUser);
				$('#Detail-WorkflowDetail-IdWorkflow').val(data.idWorkflow);
				$('#Detail-WorkflowDetail-IsAdhoc').prop('checked', data.isAdhoc);
				$('#Detail-WorkflowDetail-IsReviewer').prop('checked', data.isReviewer);
				$('#Detail-WorkflowDetail-StepName').val(data.stepName);
				$('#Detail-WorkflowDetail-StepNo').val(data.stepNo);

}
